import SkillsBox from "../components/SkillsBox";
function Work(){
    return (
        <div>
            <SkillsBox title="HTML & CSS" description="Member of the freeCodeCamp community, I picked up those awesome skills throught self-driven learning. I consolidated those skills on different online learning platforms like W3Schools, Udemy and YouTube."></SkillsBox>
            <SkillsBox  title="JavaScript"  description="Variables, Data Types, Operators | Control Structures | Functions | Arrays and Iterables | Classes and Object-oriented Programming | Working with the DOM | Working with Events"></SkillsBox>
            <SkillsBox  title="Front End Development Libraries" description="React | Bootstrap | And a little bit of: jQuery and Sass"></SkillsBox>
        </div>
    );
}

export default Work;
